### Chi-Square Test for Univariate Data (Notation) 

--

- k = Number of categories (or levels) of a categorical variable.

--

- `\(p_1\)` = True proportion for category 1

--

- `\(p_2\)` = True proportion for category 2

--

- ..... `\(p_k\)` = True proportion for category k

--

- By definition: `\(p_1 + p_2 + .... + p_k\)` = 1

--

- Ho: `\(p_1\)` = `\(po_1\)`; `\(p_2\)` = `\(po_2\)`; ....; `\(p_k\)` = `\(po_k\)`

--

- Ha: Ho is not true. 

--

- Ha: At least one of the true category proportions differs from the corresponding hypothesized values.


---

## Goodness-of-fit Statistic

--

- The goodness-of-fit statistic, denoted `\(X^2\)`, is a quantitative measure of the extent to which the observed counts differ from those expected when Ho is true.

--

- `\(X^2 = \sum_{i=1}^k \frac{(O_i - E_i)^2}{E_i}\)`, where n = Sample size, `\(O_i\)`: Observed count, `\(E_i\)`: Expected count = `\(n(po_i\)`), i = 1, 2, ..., k

--

- When the null hypothesis is true and the sample size is sufficiently large, the behavior of `\(X^2\)` is described approximately by a **chi-square distribution** with (k - 1) degrees of freedom.

--

- The chi-square distribution has no area associated with negative values and is asymmetric, with a longer tail on the right. 

--

- The chi-square is identified with a different number of degrees of freedom.

### Goodness-of-Fit - Assumptions

--

- Observed cell counts are based on a random sample.

--

- The sample size is large. 

--

- The sample size is large enough for the chi-square test to be appropriate as long as **every** expected cell count is at least 5.

A particular cell phone case is available in a choice of four different colors. A store sells all four colors. To test the hypothesis that sales are equally divided among the four colors, a random sample of 100 purchases is identified. If the resulting `\(X^2\)` value were 6.4, what conclusion would you reach when using a test with significance level 0.05?  `\(\phantom{Peck5, ex12.1, p.632}\)`

--

*1)* Rejection region approach:

--

- Table 8, right-tail area = 0.05, df = K - 1 = 4 - 1 = 3

--

- `\(\chi^2_c\)` = 7.81. Since 6.4 `\(\notin\)` (7.81, `\(\infty\)`), there is not enough evidence to reject Ho.

--

*2)* P-value approach:

--

- In Table 8, df = 3, identify the rows that contain the test statistic: 6.4

--

- Since 6.4 is between right-tail areas 0.090 and 0.095, 0.09 &lt; p-value &lt; 0.095. Since p-value &gt; 0.05, fail to reject Ho.

The statistical analysis of a sample of size `\(n\)` cross-classified in a table with I rows and J columns is called a **Contingency Table** (Summary of two categorical variables) . Contingency tables can arise in the following situations:

--

- There are *I* populations of interest, and each population is divided into *J* categories. A sample of size `\(n_i\)` is taken from the `\(i^{th}\)` population; i=1,2,...I.

--

- There is a single population of interest, with each individual in the population categorized with respect two different factors (I categories in first factor and J categories in the second).

--

The distribution of the cross-classified counts `\(n_{ij}\)` is multinomial with cell probabilities denoted by `\(p_{ij} = \frac{n_{ij}}{n}\)`. 

--

- The i-row and j-column marginal probabilities are denoted respectively by: `\(p_{i.} = \sum_j p_{ij}\)`, and `\(p_{.j} = \sum_i p_{ij}\)`

---

### Test for Homogeneity 

--

We assume that each individual in every one of the **I** populations belongs in exactly one of the **J** categories.

--

The &quot;null hypothesis of homogeneity&quot; states that the proportion of individuals in category **j** is the same for each population and that this is true for every category.

--

- Ho: `\(p_{1j} = p_{2j} = ... = p_{Ij}\)` vs Ha: Ho is not true

--

- Test statistic: `\(X^2 = \sum_i \sum_j \frac{(n_{ij} - E_{ij})^2}{E_{ij}}\)`

--

- The *ij-*expected count is `\(E_{ij} = \frac{n_{i.}n_{.j}}{n}\)`; `\(n_{i.}\)` is the i-row total, `\(n_{.j}\)` is the j-column total and n is the sample size.

--

- Assumptions: Random samples with `\(E_{ij} \geq\)` 5, `\(X^2\)` ~ `\(\chi^2_{(r-1)(c-1)}\)`

#### Testing Independence for Two Categorical Variables

--

For a random sample of **n** individuals taken from the population, each individual is assumed to belong in exactly one of the I categories associated with the first factor and exactly one of the J categories associated with the second factor. The total in the IJ-classification is denoted `\(n_{ij}\)`.

--

- Ho: `\(p_{ij} = p_{i.}p_{.j}\)`; i=1,2,...I; j=1,2,...,J.

--

- Ha: Ho is not true.

--

- Test statistic: `\(X^2 = \sum \frac{(n_{ij} - E_{ij})^2}{E_{ij}}\)`

--

- The expected count, e, is `\(E_{ij} = \frac{n_{i.}n_{.j}}{n}\)`; `\(n_{i.}\)` is the i-row total and `\(n_{.j}\)` is the j-column total.

---

- Assuming large and independent random samples. The test statistic follows a `\(\chi^2\)` distribution with **(number of rows - 1)(number of columns - 1)** degrees of freedom. 

--

- A random sample is considered large if &quot;all&quot; expected counts are at least 5. 


---

### Testing Independence for Two Categorical Variables

--

- Ho: Two categorical variables, A and B, are Independent

--

- There are **i** categories in A and **j** categories in B. If Ho is true then `\(P(A_i \cap B_j)\)` = `\(P(A_i)P(B_j)\)`

--

- `\(P(A_i \cap B_j) = \frac{n_{i.}}{n} * \frac{n_{.j}}{n} = \frac{(n_{i.})(n_{.j})}{n^2}\)`

--

- Expected count: `\((n)P(A_i \cap B_j)\)` = `\((n)\frac{(n_{i.})(n_{.j})}{n^2}\)` = `\(\frac{(n_{i.})(n_{.j})}{n} = E_{ij}\)`

--

- The test statistic `\(X^2 = \sum \frac{(O_{ij} - E_{ij})^2}{E_{ij}}\)` follows a chi-square distribution with (I-1)(J-1) degrees of freedoms.

--

- This chi-square statistic compares how rare is your observed &quot;Chi-Square&quot; with the assumed distribution.
